import TypeWriterEffect from 'react-typewriter-effect';


function Home() {
    return(
      <div className="home"> 
        <div className="homeBox">
          <h1>
          <TypeWriterEffect
            textStyle={{ fontFamily: 'Red Hat Display' }}
            startDelay={100}
            cursorColor="black"
            text="This is a single text"
            typeSpeed={100}
            scrollArea={myAppRef}
          />

          </h1>



        </div>
      </div>
  );

}

export default Home;
